INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (39085, 66, 'Cholecalciferol', 'Kidney Diseases', 'Ergocalciferol, cholecalciferol, and calcifediol undergo renal biotransformation during metabolic activation.  Renal impairment can alter metabolic and therapeutic activity of certain vitamin D analogs.  Alternative vitamin D analogs such as dihydrotachysterol (hepatic activation) and calcitriol (active form) may be considered in patients with compromised renal function.', '3', '', 'DDInter', 0);
